qStringExpression.qExpr:
=if(left('$(v_ViewUptake)', 1 ) = 'N', 
if(v_WeeklyOrCumul = 'CUM', 'Cumulative number', 'Number') &
pick(match(v_ViewTargetGroup, '80', '70', '60', '50', 'HCW', 'LTCF'),
' of first doses, primary courses and booster/additional vaccine dose administered to people aged 80 years and above in ',
' of first doses, primary courses and booster/additional vaccine dose administered to people aged 70 years and above in ',
' of first doses, primary courses and booster/additional vaccine dose administered to people aged 60 years and above in ',
' of first doses, primary courses and booster/additional vaccine dose administered to people aged 50 years and above in ',
' of first doses, primary courses and booster/additional vaccine dose administered to healthcare workers in ',
' of first doses, primary courses and booster/additional vaccine dose administered to LTCF residents in ',
),
pick(match(v_ViewUptake & '_' & v_ViewTargetGroup, 'FIRST_60', 'SECOND_60', 'ADD_60', 'FIRST_HCW', 'SECOND_HCW', 'ADD_HCW', 'FIRST_LTCF', 'SECOND_LTCF', 'ADD_LTCF'),
if(GetSelectedCount([Member State])=1,  'Cumulative uptake (%) of at least one vaccine dose' , 'Cumulative vaccine uptake') & ' among people aged 60 years and above in ', 
if(GetSelectedCount([Member State])=1,  'Cumulative uptake (%) of the primary course' , 'Cumulative vaccine uptake') & ' among people aged 60 years and above in ',
if(GetSelectedCount([Member State])=1,  'Cumulative uptake (%) of a booster/additional vaccine dose' , 'Cumulative vaccine uptake') & ' among people aged 60 years and above in ',

if(GetSelectedCount([Member State])=1,  'Cumulative uptake (%) of at least one vaccine dose' , 'Cumulative vaccine uptake') & ' among healthcare workers in ',
if(GetSelectedCount([Member State])=1,  'Cumulative uptake (%) of the primary course' , 'Cumulative vaccine uptake') & ' among healthcare workers in ',
if(GetSelectedCount([Member State])=1,  'Cumulative uptake (%) of a booster/additional vaccine dose' , 'Cumulative vaccine uptake') & ' among healthcare workers in ',

if(GetSelectedCount([Member State])=1,  'Cumulative uptake (%) of at least one vaccine dose' , 'Cumulative vaccine uptake') & ' among LTCF residents in ',
if(GetSelectedCount([Member State])=1,  'Cumulative uptake (%) of the primary course ', 'Cumulative vaccine uptake') & ' among LTCF residents in ',
if(GetSelectedCount([Member State])=1,  'Cumulative uptake (%) of a booster/additional vaccine dose' , 'Cumulative vaccine uptake') & ' among LTCF residents in ',
) 
)
& if(GetSelectedCount([Member State])=1, [Member State] & ' vs. ' & v_EU27_EEA_Title,   v_EU27_EEA_Title)
& ' as of '& date(ReloadTime(), 'YYYY-MM-DD')
